function parseMarkdown(){$("#preview").html(marked($("#editor").val(),{renderer:renderer,gfm:!0,breaks:!0}))}const projectName="markdown-previewer";localStorage.setItem("example_project","Markdown Previewer");const renderer=new marked.Renderer,linkRenderer=renderer.link;renderer.link=function(e,r,n){const a=linkRenderer.call(renderer,e,r,n);return a.replace(/^<a /,'<a target="_blank" rel="nofollow" ')},$(document).ready(function(){parseMarkdown(),$("#editor").on("change keypress keyup keydown",function(){parseMarkdown()})});